import React, { useState } from "react";

const Input = (props) => {
  return (
    <form>
      <input
        onChange={props.handle}
        type="text"
        name="movie"
        placeholder="Search for a Movie,Show"
        value={props.value}
        onKeyPress={props.search}
      />
    </form>
  );
};

export default Input;
